import React from 'react';

import './style.css';

const ProfilePage = (props, context) => {

    return (
        <div className="profile-page">
        <main className="bg-color">
        <div className="profile-wrapper">
            <h1>This is the profile page</h1>
            </div>
        </main>
        </div>
    )
}

export default ProfilePage;
